import headerLogo from "./../../images/header_logo.svg";
import Navigation from "../Navigation/Navigation.js";

function Header() {
  return (
    <div className="header">
      <img className="header_logo" src={headerLogo} alt="Логотип" />
      <Navigation />
    </div>
  );
}

export default Header;
